import React, { useEffect, useState, useRef } from 'react';
import { NavLink } from 'react-router-dom';
import { useAtom } from 'jotai';

import * as S from './Styled.GetPosts';
import { Post } from '../../types/supabase';
import { supabase } from '../../services/supabase/supabase';
import { filterdcategories } from '../category/Category';
import { searchKeywordAtom } from '../common/Search';
import { getIconComponet } from './MuiBtn';

// MUI- Material Icons
import Button from '@mui/material/Button';

export const GetPost = () => {
  const [posts, setPosts] = useState<Post[]>([]);
  const [filteredPosts, setFilteredPosts] = useState<Post[]>([]);
  const [searchKeyword] = useAtom(searchKeywordAtom);
  const [currentPage, setCurrentPage] = useState<number>(1);
  const [isLoading, setIsLoading] = useState<boolean>(false); // Add loading state

  const lastPostRef = useRef<HTMLDivElement | null>(null);

  useEffect(() => {
    const fetchPosts = async () => {
      setIsLoading(true);

      const PAGE_SIZE = 8;
      const { data, error } = await supabase
        .from('posts')
        .select('*')
        .range((currentPage - 1) * PAGE_SIZE, currentPage * PAGE_SIZE - 1);

      if (error) {
        console.error('Error fetching posts:', error);
      } else {
        const postsWithCompleteURLs = data.map((post) => ({
          ...post,
          image_urls: post.image_urls ? post.image_urls.replace(/\[|\]|"/g, '').split(',') : []
        }));

        setPosts((prevPosts) => [...prevPosts, ...postsWithCompleteURLs]);
        setFilteredPosts((prevFilteredPosts) => [...prevFilteredPosts, ...postsWithCompleteURLs]);
        setCurrentPage((prevPage) => prevPage + 1);
      }

      setIsLoading(false);
    };

    fetchPosts();
  }, [currentPage]);

  useEffect(() => {
    // Apply filters when searchKeyword or posts change
    const applyFilters = () => {
      let filtered = posts;

      if (searchKeyword.trim() !== '') {
        const keywordLower = searchKeyword.toLowerCase();
        filtered = filtered.filter((post) => post.title.toLowerCase().includes(keywordLower));
      }

      setFilteredPosts(filtered);
    };

    applyFilters();
  }, [searchKeyword, posts]);

  const handleScroll = () => {
    const scrollThreshold = 200;
    if (
      !isLoading &&
      lastPostRef.current &&
      window.innerHeight + window.scrollY >= lastPostRef.current.offsetTop - scrollThreshold
    ) {
      setCurrentPage((prevPage) => prevPage + 1);
    }
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, [isLoading]);

  const handleCategoryClick = (category: string) => {
    if (category === '전체') {
      setFilteredPosts(posts);
    } else {
      const filteredPosts = posts.filter((post) => post.category === category);
      setFilteredPosts(filteredPosts);
    }
  };

  const categoryButtons = filterdcategories.map((category) => {
    const IconComponent = getIconComponet(category.value);
    return (
      <Button
        key={category.value}
        value={category.value}
        onClick={() => handleCategoryClick(category.value)}
        variant="outlined"
        startIcon={<IconComponent />}
      >
        {category.label}
      </Button>
    );
  });

  return (
    <>
      <S.ButtonGrid>{categoryButtons}</S.ButtonGrid>

      <S.PostContainer>
        {filteredPosts.map((post, index) => (
          <NavLink to={`/post/${post.pid}`} key={post.pid} style={{ textDecoration: 'none', color: 'inherit' }}>
            <S.PostItem>
              <h2>{post.title}</h2>
              <div>
                {post.image_urls.length > 0 && (
                  <S.Image
                    src={`${process.env.REACT_APP_SUPABASE_STORAGE_URL}${post.image_urls[0]} `}
                    alt={post.title}
                  />
                )}
              </div>
            </S.PostItem>
          </NavLink>
        ))}
        {isLoading && <div>Loading...</div>}
        <div ref={lastPostRef}></div>
      </S.PostContainer>
      <S.EndMessage>더 이상의 게시물이 없습니다.</S.EndMessage>
    </>
  );
};

export default GetPost;
